                              "43200":"сут.",
                              "86400":"12ч",
                              "3600":"час",
                              "1800":"30м",
                              "900":"15м",
                              "60":"мин",
                              "10":"10с",
                             };
                return this.node.rtypes.map(
                    function (value) {
                        return {value: value, label: labels[value]}
                    });
            },
        },
            created: function(){
                this.navigate = _.debounce(this.navigate, 500);
            },
                
