              this.node=node;
              this.setupReport();
          }
      },
          navigate: function(node){
              this.$router.push({
                  name: 'reportpath',
                  params: {pid: node.id, mode: node.mode},
                  query: {
                           type: node.type,
                           oneperiod: node.data.oneperiod,
                      startdate: node.fromdate,
                      enddate: node.todate,
                  },
                  });
          },
              
          is_disabled: function(data, node){
              return data.reporttype===""
          },
              setupReport: function (){
                  this.dialogReportVisible = false;
                  if (!this.node.hasOwnProperty('type')) {
                      this.$set(this.node, "type", this.node.rtypes[0])
                  };
                  this.node.mode=(this.node.type=='getMirror'||!this.node.todate)?'view':'load';

